import React from 'react'
import { Link } from 'react-router-dom'
import './newdaybutton.css'

export const NewDayButton =() => {

  return (  
    <div className="ButtonDiv">
      <Link to={`/newReflection/`}>
        <button className="NewDayButton">

        New Day :-)
      </button>
      </Link>
    </div>
  )
}


